import React from 'react';
import './Home.scss';

function Home() {
  return (
    <div className="home">
      <button><a href="#google">click to go to google</a></button>
      <button><a href="#facebook">click to go to facebook</a></button>
      <div className="google" id="google">GOOGLE</div>
      <div className="facebook" id="facebook">FACEBOOK</div>
    </div>
  )
}

export default Home;


